export function renderZoneCards(e){const n=document.getElementById("zoneCards");if(!n||!e)return;n.innerHTML="";const o={};for(const n of e.features){const e=n.properties.zona??"Sin zona";o[e]||(o[e]=0),o[e]++}Object.entries(o).forEach(([e,o])=>{const r=document.createElement("div");r.className="card zone-card",r.innerHTML=`\n      <div class="label">${e}</div>\n      <div class="value">${o} negocio${1===o?"":"s"}</div>\n    `,n.appendChild(r)})}